function [ys_, params, info] = steadystate(ys_, exo_, params)
% Steady state generated by Dynare preprocessor
    info = 0;
    ys_(8)=params(13);
    ys_(1)=1.0;
    ys_(19)=1.0;
    ys_(3)=params(5);
    ys_(2)=1-params(5);
    ys_(5)=params(6)*exp(params(3));
    ys_(7)=params(5)*ys_(5);
    ys_(6)=(1-params(5))*ys_(5);
    ys_(10)=ys_(8)*params(5);
    ys_(9)=ys_(8)*(1-params(5));
    ys_(4)=exp(params(3))^(1-params(7))*(ys_(2)*ys_(2)/ys_(1)/(ys_(6)^(1-params(7))*ys_(9)^params(7))+ys_(3)*ys_(3)/ys_(1)/(ys_(7)^(1-params(7))*ys_(10)^params(7)));
    ys_(11)=0;
    ys_(13)=0;
    ys_(12)=0;
    ys_(14)=0;
    alpha_N_ss=params(7);
    ys_(17)=ys_(19)*ys_(3)*alpha_N_ss/ys_(10);
    theta_N_s=ys_(17)/ys_(8)^(1/params(4));
    ys_(18)=ys_(2)-theta_N_s*ys_(8)^(1+1/params(4))/(1+1/params(4));
    r_ss=exp(params(3))^params(1)/params(2)-1.0;
    delta_ss=1+params(5)/params(6)-exp(params(3));
    alpha_K_ss=params(6)*(r_ss+delta_ss);
    ys_(20)=params(3);
    ys_(15)=ys_(10)*ys_(17)*exp(ys_(20))*alpha_K_ss/alpha_N_ss/ys_(7);
    ys_(16)=ys_(15);
    ys_(21)=0;
    ys_(22)=0;
    ys_(23)=0;
    ys_(24)=0;
    ys_(27)=0;
    ys_(29)=0;
    log_util=0;
    ys_(30)=0;
    ys_(31)=0;
    ys_(32)=0;
    lab_prod_obs=0;
    ys_(38)=0;
    ys_(35)=0;
    % Auxiliary equations
end
